// src/Pages/User/SubmitFeedback.js
import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";


export default function SubmitFeedback() {
  const navigate = useNavigate();
  const [mentorName, setMentorName] = useState("");
  const [week, setWeek] = useState("");
  const [queries, setQueries] = useState("");
  const [openQueries, setOpenQueries] = useState("");
  const [description, setDescription] = useState("");
  const [rating, setRating] = useState(1);
  const [user, setUser] = useState("");

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) navigate("/UserLogin");

    const payload = JSON.parse(atob(token.split(".")[1]));
    setUser(payload["http://schemas.microsoft.com/ws/2008/06/identity/claims/name"]);
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/UserLogin");
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const token = localStorage.getItem("token");
    if (!token) return alert("You must be logged in to submit feedback.");

    const feedbackData = { mentorName, week, queries, openQueries, description, rating: Number(rating) };

    try {
      const res = await fetch("https://localhost:7079/api/Feedback/submit-feedback", {
        method: "POST",
        headers: { "Content-Type": "application/json", "Authorization": `Bearer ${token}` },
        body: JSON.stringify(feedbackData),
      });
      const text = await res.text();
      if (!res.ok) throw new Error(text || "Failed to submit feedback");

      alert("Feedback submitted successfully!");
      setMentorName(""); setWeek(""); setQueries(""); setOpenQueries(""); setDescription(""); setRating(1);
    } catch (err) {
      console.error(err);
      alert("Error submitting feedback. Check console.");
    }
  };

  return (
    <div className="page-container">
      <header className="page-header">
        <h2>Welcome, {user}</h2>
        <button onClick={handleLogout} className="logout-btn">Logout</button>
      </header>

      <div className="content-container">
        <div className="form-container">
          <h2 className="form-title">Freshers 2025 - AppDev - Feedback survey about your Mentor</h2>
          <form onSubmit={handleSubmit}>
            <label>Your Mentor full name</label>
            <input type="text" value={mentorName} onChange={(e) => setMentorName(e.target.value)} required />

            <label>Choose the Week you are providing review for</label>
            <select value={week} onChange={(e) => setWeek(e.target.value)} required>
              <option value="">Select Week</option>
              {Array.from({ length: 12 }, (_, i) => <option key={i} value={`Week ${i + 1}`}>Week {i + 1}</option>)}
            </select>

            <label>Did your mentor answer all your questions this week?</label>
            <select value={queries} onChange={(e) => setQueries(e.target.value)} required>
              <option value="">-- Select --</option>
              <option value="Yes">Yes</option>
              <option value="No">No</option>
            </select>

            <label>If you have open queries, describe them</label>
            <input type="text" value={openQueries} onChange={(e) => setOpenQueries(e.target.value)} placeholder="Type NA if no open queries" />

            <label>How many lines of code did you write this week?</label>
            <input type="text" value={description} onChange={(e) => setDescription(e.target.value)} />

            <label>Overall rating for your mentor</label>
            <select value={rating} onChange={(e) => setRating(e.target.value)}>
              <option value={1}>⭐</option>
              <option value={2}>⭐⭐</option>
              <option value={3}>⭐⭐⭐</option>
              <option value={4}>⭐⭐⭐⭐</option>
              <option value={5}>⭐⭐⭐⭐⭐</option>
            </select>

            <button type="submit">Submit Feedback</button>
          </form>
        </div>
      </div>
    </div>
  );
}
